  constructor(){
    super();
    this.state = {
      notas:[]
    }
  }

  criarCarta(numero){
    console.log('numero é',numero)
    const dados = bd[1]
    console.log('dados são',dados)
  }

  render(){
    return(
      <section className="conteudo">
        <Card/>
        <Card/>
        <Jogar criarCarta={this.criarCarta.bind(this)}/>
      </section>
    )
  }


}



export default App;
